import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { motion } from 'framer-motion';
import ProductCard from './ProductCard';
import { setProducts, setLoading, setCategory, setSortBy } from '../store/productsSlice';

const ProductList = () => {
  const { filteredItems, categories, selectedCategory, sortBy, loading } = useSelector(state => state.products);
  const dispatch = useDispatch();

  useEffect(() => {
    // Mock product data - replace with actual API call
    const mockProducts = [
      {
        id: 1,
        name: "Nike Air Max 270",
        price: 150,
        originalPrice: 200,
        discount: 25,
        rating: 4.5,
        reviews: 128,
        category: "Sneakers",
        image: "https://images.unsplash.com/photo-1542291026-7eec264c27ff?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
        sizes: [7, 8, 9, 10, 11, 12],
        inStock: true
      },
      {
        id: 2,
        name: "Adidas Ultraboost 22",
        price: 180,
        rating: 4.7,
        reviews: 95,
        category: "Sports",
        image: "https://images.unsplash.com/photo-1608231387042-66d1773070a5?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
        sizes: [7, 8, 9, 10, 11],
        inStock: true
      },
      {
        id: 3,
        name: "Converse Chuck Taylor",
        price: 65,
        rating: 4.2,
        reviews: 203,
        category: "Casual",
        image: "https://images.unsplash.com/photo-1549298916-b41d501d3772?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
        sizes: [6, 7, 8, 9, 10, 11, 12],
        inStock: true
      },
      {
        id: 4,
        name: "Oxford Dress Shoes",
        price: 120,
        rating: 4.4,
        reviews: 67,
        category: "Formal",
        image: "https://images.unsplash.com/photo-1614252369475-531eba835eb1?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
        sizes: [8, 9, 10, 11, 12],
        inStock: true
      },
      {
        id: 5,
        name: "Puma RS-X",
        price: 110,
        originalPrice: 140,
        discount: 21,
        rating: 4.3,
        reviews: 89,
        category: "Sneakers",
        image: "https://images.unsplash.com/photo-1595950653106-6c9ebd614d3a?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
        sizes: [7, 8, 9, 10, 11],
        inStock: true
      },
      {
        id: 6,
        name: "New Balance 990v5",
        price: 175,
        rating: 4.6,
        reviews: 156,
        category: "Sports",
        image: "https://images.unsplash.com/photo-1606107557195-0e29a4b5b4aa?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
        sizes: [7, 8, 9, 10, 11, 12],
        inStock: true
      }
    ];

    dispatch(setLoading(true));
    setTimeout(() => {
      dispatch(setProducts(mockProducts));
    }, 500);
  }, [dispatch]);

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary"></div>
      </div>
    );
  }

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <div className="flex flex-col md:flex-row justify-between items-center mb-8">
        <h2 className="text-3xl font-bold text-gray-800 mb-4 md:mb-0">Our Products</h2>

        <div className="flex flex-col sm:flex-row gap-4">
          <select
            value={selectedCategory}
            onChange={(e) => dispatch(setCategory(e.target.value))}
            className="px-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-primary"
          >
            {categories.map(category => (
              <option key={category} value={category}>{category}</option>
            ))}
          </select>

          <select
            value={sortBy}
            onChange={(e) => dispatch(setSortBy(e.target.value))}
            className="px-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-primary"
          >
            <option value="name">Sort by Name</option>
            <option value="price-low">Price: Low to High</option>
            <option value="price-high">Price: High to Low</option>
            <option value="rating">Highest Rated</option>
          </select>
        </div>
      </div>

      <motion.div
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6"
      >
        {filteredItems.map((product, index) => (
          <motion.div
            key={product.id}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: index * 0.1 }}
          >
            <ProductCard product={product} />
          </motion.div>
        ))}
      </motion.div>

      {filteredItems.length === 0 && (
        <div className="text-center py-12">
          <p className="text-gray-500 text-lg">No products found matching your criteria.</p>
        </div>
      )}
    </div>
  );
};

export default ProductList;
